import React from 'react';
import styles from '../css/Card.module.css';
import bombomImage from '../img/bombom.jpeg'; // Importa la imagen desde la carpeta correcta

const Card = () => {
  return (
    <div className={styles.card}>
      <img src={bombomImage} alt="Usuario" className={styles.image} /> {/* Usa la imagen importada */}
      <h2 className={styles.title}>Nombre del Usuario</h2>
      <p className={styles.description}>
        Este es un breve resumen sobre el usuario. Aquí se pueden incluir más detalles.
      </p>
      <button className={styles.button}>Ver Perfil</button>
    </div>
  );
};

export default Card;
